(null, null, 65, null, 'Kandinsky Wassily', 'Munich / MonacoGermany', 'wassily-kandinsky', 189273, null, null, null, 664, 'Blue rider', 189246, null, 'Expressionism', 1903, 55, 623, 'Private Collection', 'The Blue Rider is perhaps Kandinsky’s most important painting from the early 1900’s, before he had fully developed his abstract style of music as sound. The painting illustrates a rider cloaked in blue, speeding through a greenish meadow. The painting’s intentional abstractness had led many art theorists to project their own representations onto the figure, some seeing a child in the arms of the blue rider. Allowing viewers to participate in the representations of the art was a technique that Kandinsky would use to great fruition in his many later works, which became more and more abstract as his career wore on.', 'horsemen, forests-and-trees', '1903', 'landscape', 'https://uploads4.wikiart.org/images/wassily-kandinsky/blue-rider-1903.jpg!Large.jpg', '{417, 504}', null, 'blue-rider-1903'),
