('Compositions', null, 250.5, null, 'Kandinsky Wassily', 'Munich / MonacoGermany', 'wassily-kandinsky', 189284, null, null, null, 1132, 'Composition IV', 189246, null, 'Abstract Art', 1911, 159.5, 716, 'Kunstsammlung Nordrhein-Westfalen, Düsseldorf, Germany', 'An interesting story that indicates Kandinsky’s intellectual examination in the creation of his works revolves around this composition. He became exhausted during the months of studying he went through in preparation for this painting, and decided to go for a walk. His assistant at the time, Gabrielle Munter, who was tidying up the studio in the artist’s absence, inadvertently turned the canvas on its side. Upon Kandinsky’s return, he saw the canvas, fell to his knees and began weeping at the beauty of the painting. His newly found perspective on the piece would change his artistic vision and direction for the rest of his life. ', null, '1911', 'abstract', 'https://uploads8.wikiart.org/images/wassily-kandinsky/composition-iv-1911.jpg!Large.jpg', '{389, 0}', null, 'composition-iv-1911'),
