('Compositions', null, 300, null, 'Kandinsky Wassily', 'Munich / MonacoGermany', 'wassily-kandinsky', 189287, null, null, null, 1132, 'Composition VI', 189246, null, 'Abstract Art', 1913, 195, 745, 'Hermitage Museum, Saint Petersburg, Russia', 'Kandinsky spent nearly six months preparing to create this painting, at first intending the work to evoke a flood, baptism, destruction and rebirth all at the same time. He first outlined the work on an oversized wooden panel, but soon experienced an artistic block, and found himself unable to paint. Gabrielle Munter, his assistant at the time, told him that he was blocked, and he needed to release himself from his intellectual trappings surrounding the painting. She suggested that he simply repeat the word “uberflut,” meaning “flood” or “deluge,” focusing on the sound of the word rather than its meaning, releasing his mind from the artistic block and focusing only on the music of the word. Kandinsky set down to work, and completed the painting in three days, all the while repeating the word like a mantra. ', null, '1913', 'abstract', 'https://uploads8.wikiart.org/images/wassily-kandinsky/composition-vi-1913.jpg!Large.jpg', '{389, 0}', null, 'composition-vi-1913'),
