(null, null, 98, null, 'Kandinsky Wassily', 'Germany', 'wassily-kandinsky', 189374, null, null, null, 510, 'On White II', 189246, null, 'Abstract Art', 1923, 105, 620, 'Georges Pompidou Center, Paris, France', 'Kandinsky’s On White II expresses an intelligent combination of the two main colors in the painting: black and white. Kandinsky used color to represent more than just shapes and figures in his paintings. In this painting the many dimensions of the color white is used to represent the many possibilities and opportunities available in life. The color black, on the other hand, represents non-existence and death. Kandinsky expressed the color black as the silence of death, and in this painting, the black cuts through the white background with a riotous effect, shattering the peace of the colorful combination of colors, or as it were, opportunities in life.', null, '1923', 'abstract', 'https://uploads5.wikiart.org/images/wassily-kandinsky/on-white-ii-1923.jpg!Large.jpg', '{389, 0}', null, 'on-white-ii-1923'),
