('Compositions', null, 195, null, 'Kandinsky Wassily', 'ParisFrance', 'wassily-kandinsky', 189290, null, null, null, 1063, 'Composition X', 189246, null, 'Abstract Art', 1939, 130, 718, 'Kunstsammlung Nordrhein-Westfalen, Düsseldorf, Germany', 'Kandinsky often related the painting of colors and pictures on a canvas to the composition of beautiful music, and as such, named many of his paintings variants of Composition. His analogy of art as a musical composition revolved around the piano: the eyes were the hammers, the color is the keyboard, and the soul is the piano and strings. Similar to music, which is not just jumbles of notes, Kandinsky’s works were not just amalgamations of non distinct shapes and colors. They were carefully arranged musical elements, precisely proportioned to evoke the maximum aesthetic and emotional response from the viewer.  ', null, '1939', 'abstract', 'https://uploads7.wikiart.org/images/wassily-kandinsky/composition-x-1939.jpg!Large.jpg', '{389, 0}', null, 'composition-x-1939'),
